import { connect } from 'react-redux';
import ReactPlayer from 'react-player'
import { PlayerIcon } from 'react-player-controls'

class Player extends Component{
  state = {
    url: "test"
  }

  render(){
    console.log('PLAYER PROPS',this.props)
    let url;
    if(this.props.selectedSprite.sound){
      url = this.props.selectedSprite.sound.url
    }else{
      url = "test"
    }
      return(
        <div>
          <ReactPlayer className='player' width={300} height={50} url={url} playing controls={true} loop={true}/>
        </div>
      )
    }
}

function mapStateToProps(state) {
  return {
    selectedSprite: state.sprite.selectedSprite
  }
}

